import { useEffect, useState } from "react";

const PRIORITY_COLORS = {
  Critical: "border-red-600",
  High: "border-orange-500",
  Medium: "border-yellow-400",
  Low: "border-green-400",
};

export default function Dashboard() {
  const [tickets, setTickets] = useState([]);
  const [expandedTicketId, setExpandedTicketId] = useState(null);

  useEffect(() => {
    fetch("http://localhost/tickets-api/tickets_latest.php")
      .then((res) => res.json())
      .then((data) => setTickets(data))
      .catch((err) => console.error("Eroare la fetch:", err));
  }, []);

  const toggleExpand = (id) => {
    setExpandedTicketId(expandedTicketId === id ? null : id);
  };

  const formatDate = (date) => {
    if (!date) return "-";
    if (typeof date === "string") return date.split("T")[0];
    try {
      return new Date(date).toLocaleDateString();
    } catch {
      return "-";
    }
  };

  return (
    <div className="min-h-screen bg-gray-100 p-8">
      <div className="max-w-5xl mx-auto bg-white shadow-xl rounded-2xl p-6">
        <h1 className="text-3xl font-bold mb-6 text-gray-800 text-center">Dashboard - Tickete</h1>
        <div className="space-y-4">
          {tickets.map((ticket) => (
            <div
              key={ticket.id}
              className={`flex items-center justify-between p-4 rounded-lg border-l-8 shadow-md hover:bg-gray-50 transition ${
                PRIORITY_COLORS[ticket.priority_name] || "border-gray-300"
              }`}
            >
              <div className="flex flex-col">
                <span className="font-semibold text-lg text-gray-800">{ticket.incident_title}</span>
                <div className="text-gray-600 text-sm flex flex-wrap gap-2">
                  <span><strong>Status:</strong> {ticket.status}</span>
                  <span><strong>Prioritate:</strong> {ticket.priority_name}</span>
                  <span><strong>Creat de:</strong> {ticket.created_by}</span>
                  <span><strong>Start:</strong> {formatDate(ticket.start_date)}</span>
                </div>
              </div>

              <button
                onClick={() => toggleExpand(ticket.id)}
                className="ml-4 bg-blue-500 text-white w-8 h-8 rounded-full flex items-center justify-center hover:bg-blue-600"
              >
                {expandedTicketId === ticket.id ? "-" : "+"}
              </button>
            </div>
          ))}
        </div>

        {/* Detalii extinse */}
        {expandedTicketId && (
          <div className="mt-8 bg-gray-50 p-6 rounded-lg shadow-inner">
            {tickets
              .filter((ticket) => ticket.id === expandedTicketId)
              .map((ticket) => (
                <div key={ticket.id} className="space-y-2 text-gray-700 text-sm">
                  <h2 className="text-xl font-bold mb-4 text-gray-800">{ticket.incident_title}</h2>
                  <p><strong>Assigned Person:</strong> {ticket.assigned_person || "-"}</p>
                  <p><strong>Team:</strong> {ticket.team_assigned_person || "-"}</p>
                  <p><strong>Project:</strong> {ticket.project || "-"}</p>
                  <p><strong>Comment:</strong> {ticket.comment || "-"}</p>
                  <p><strong>Resolution:</strong> {ticket.resolution || "-"}</p>
                  <p><strong>Start Date:</strong> {formatDate(ticket.start_date)}</p>
                  <p><strong>Closed Date:</strong> {formatDate(ticket.closed_date)}</p>
                </div>
              ))}
          </div>
        )}
      </div>
    </div>
  );
}
